import{_ as e,c as a,o as t,b as o}from"./app.b796f998.js";const f=JSON.parse('{"title":"Dragon Boat Festival","description":"","frontmatter":{"title":"Dragon Boat Festival"},"headers":[{"level":2,"title":"浑浑噩噩","slug":"浑浑噩噩","link":"#浑浑噩噩","children":[]},{"level":2,"title":"有待沉淀","slug":"有待沉淀","link":"#有待沉淀","children":[]},{"level":2,"title":"端午快乐","slug":"端午快乐","link":"#端午快乐","children":[]}],"relativePath":"mood/dragonBoat.md"}'),r={name:"mood/dragonBoat.md"},n=o('<h2 id="浑浑噩噩" tabindex="-1">浑浑噩噩 <a class="header-anchor" href="#浑浑噩噩" aria-hidden="true">#</a></h2><p>端午小假期来临，早上醒来都是 11 点多了，深圳的天下起了小雨，与往常一样就待在屋里吧。但我有些迷茫，不知道该做些什么...</p><p>前几天接种了第一针新冠疫苗，这几天手臂都有些酸疼无力...</p><p>感觉做什么都打不起精神，看会儿电影？！但不一会儿就觉得有点儿困了，顺便拉上窗帘睡一觉吧。房内昏暗寂静，窗外却有些嘈杂（机器的轰鸣声，小孩的吵闹声，大人的呼喊声...），可不知不觉就入眠了，再睁眼时天已经全黑了，看看时间，已经是晚上九点多了（一觉睡了五六个小时...）</p><p>这时候，我该点份外卖呢，自己做一点，还是自己出去吃一顿，吃什么好呢？！周围的外卖我也不知道吃什么好... 前几天自己咬破了嘴巴，没有忌口的结果就是发展成了溃疡 o(╥﹏╥)o 疼得要死... 然后就什么都不想吃了</p><p>浑浑噩噩的，带着倦意，才想起一天什么都没干，cao！</p><h2 id="有待沉淀" tabindex="-1">有待沉淀 <a class="header-anchor" href="#有待沉淀" aria-hidden="true">#</a></h2><p>其实最近正在准备换一家公司，面试了几家，有拿到 offer 的，也有第一轮就挂了的，也有没达到自己期望而拒绝了 offer 的</p><p>通过一次次的面试，面试问过的问题基本都能说出来一点，但也有一些模棱两可的答案，说明我之前自学过程中不够扎实，也没有去发散思维去深究，导致印像不深而遗忘了这么些知识点，当然也有没接触过的知识点... 那毕竟会的越多，不会的就越多</p><p>想去拼个大厂，毕竟人家比较看重基础跟个人发展能力。学历方面仅仅达到了及格线，但人家 HR 拿到简历直接 pass 掉了，虽然觉得自己可能大概率过不了人家的面试，但毕竟想去先 &quot;看看世界，开开眼界&quot; 嘛~</p><p>基础部分还是之前自学的底子，复习却感到无从下手。自己平常也没有去练习算法，这本该日积月累的东西，我这么几天大抵也补不出来（除非专门抽一两个月时间去沉淀自己，从语法基础、算法再到框架原理这一套），但这确实需要一个过程</p><p>总之，自己需要沉淀，还是需要好好准备的啊~</p><h2 id="端午快乐" tabindex="-1">端午快乐 <a class="header-anchor" href="#端午快乐" aria-hidden="true">#</a></h2><p>最后，今天五月初五辣，告诉自己端午快乐吼！</p><blockquote><p>BGM: <a href="https://www.kugou.com/song/#hash=2042DC2E6B1E7055DFB46F53B2957EBC&amp;album_id=584613" target="_blank" rel="noreferrer">《森と水の幻想曲》 —— 神山純一</a></p></blockquote>',15),p=[n];function i(l,s,d,c,h,_){return t(),a("div",null,p)}const m=e(r,[["render",i]]);export{f as __pageData,m as default};
